import React, { Component } from 'react';
import logo from './logo.svg';
import Toolbar from './components/Toolbar/Toolbar';
import {BrowserRouter, Route} from 'react-router-dom';


class App extends Component{
  render() {
    return ( 
    <BrowserRouter>
    <div className="App">
      <Toolbar />
    </div>
    </BrowserRouter>
    )
  } 
}

export default App;
